Een jongeman in New York maakt het uit met zijn vriendin, maar tot zijn schrik ontdekt hij dat ze eigenlijk een superheldin met 
bijbehorende superkrachten is: G-Girl. Wat nog erger is: ze is er niet bepaald blij mee dat hij het uit heeft gemaakt en besluit 
zijn leven tot een hel te maken.
